    SET timestamp = json_unquote(json_extract(data, '$.timestamp'));
    SET type = json_unquote(json_extract(data, '$.type'));

    VALUES (`transaction_id`, `customer`, `type`, `timestamp`, `sub_total`, `service_charge`, `grand_total`, `discount`, `payment`);
