END$$

CREATE FUNCTION `get_total_prepaid_load_profit` (`dateStart` TIMESTAMP, `dateEnd` TIMESTAMP) RETURNS DECIMAL(13,2) UNSIGNED function_get_total_prepaid_load_profit:
